import React from "react"
import './App.css';

import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
// Google maps api key AIzaSyAQnnrSxmjA4pPJuFsiSUBjZ0gL0Uq9D7Q

const mapStyles = {
  width: '50%',
  height: '300px',
  position: 'inherit'
};



class Planit extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
     	stores: [{lat: 47.49855629475769, lng: -122.14184416996333},
              {latitude: 47.359423, longitude: -122.021071},
              {latitude: 47.2052192687988, longitude: -121.988426208496},
              {latitude: 47.6307081, longitude: -122.1434325},
              {latitude: 47.3084488, longitude: -122.2140121},
              {latitude: 47.5524695, longitude: -122.0425407}]
    }

  }

  displayMarkers = () => {
    return this.state.stores.map((store, index) => {
      return <Marker key={index} id={index} position={{
       lat: store.latitude,
       lng: store.longitude
     }}
     onClick={(marker) => console.log("You clicked me!", marker)} />
    })
  }

  render() {
    return (
    	<div className="container-fluid planit-container">
	      <h1>Planit</h1>
	      <div className="map-container">
	      	<Map
		        google={this.props.google}
		        zoom={8}
		        style={mapStyles}
		        initialCenter={{ lat: 38.9399, lng: -119.9772}}
		      >
		      {this.displayMarkers()}
		      </Map>
	      </div>

	    </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyAQnnrSxmjA4pPJuFsiSUBjZ0gL0Uq9D7Q'
})(Planit);
